public void basicResponseAssertion(Context<StateResponseDTO> context, String expectedResult) throws FileNotFoundException {
        StateServiceAssertions.assertStatusCode(context.getResponseStatusCode(), HttpStatus.SC_OK);
        BufferedReader br = new BufferedReader(new FileReader(expectedResult));
        StateResponseDTO stateResponseDTO = new GsonBuilder()
                .registerTypeAdapterFactory(new ArrayAdapterFactoryUtil())
                .create()
                .fromJson(br, StateResponseDTO.class);
        System.out.println(stateResponseDTO.getRestResponse());

        StateServiceAssertions.validateObjects(context.getObjectFromResponse(), stateResponseDTO);
    }
